import React, { Component, useState } from 'react';
import { StyleSheet, View, Text, Button, Image, ImageBackground, TouchableOpacity,Modal,TouchableHighlight, StatusBar} from 'react-native';
import { globalStyles } from '../styles/global';
import Location from '../screens/locations'
import FitImage from 'react-native-fit-image';
import { MaterialIcons } from '@expo/vector-icons';


export default function Home( {navigation} ) {


const [modalVisible, setModalVisible] = useState(false);
const image = require('../assets/homebg.jpeg')
  return (

    <View style={globalStyles.container}>
        <StatusBar
     backgroundColor="blue"
     barStyle="light-content"
   />

    <ImageBackground source={image} style={globalStyles.image}>
        <View style={globalStyles.contentSort}>



        <Modal
        animationType="slide"
        transparent={false}
        visible={modalVisible}
        onRequestClose={() => {
          Alert.alert('Modal has been closed.');
        }}>
            <ImageBackground source={image} style={globalStyles.image2}>
             <View style={{ marginTop: 22 }}>

          <View>



            <TouchableHighlight
              onPress={() => {
                setModalVisible(!modalVisible);

              }}
              style={globalStyles.closeModalContainer}>
                  <View style={globalStyles.closeModal}>
              <Text ></Text>
              <MaterialIcons name="close" size={32} color="white" />
              </View>
            </TouchableHighlight>

          </View>
        </View>
        <Location/>
        </ImageBackground>

      </Modal>



      <Text style={globalStyles.text}>Church This Sunday</Text>

    <TouchableHighlight
              onPress={() => {
                setModalVisible(!modalVisible);
              }}
              style={globalStyles.button}
              >
              <Text style={globalStyles.buttonText}>Open Locations</Text>
            </TouchableHighlight>


      </View>
    </ImageBackground>
  </View>
  );
}

<Button
title="Go to Profile"

/>
